import React from 'react';
import Contact from '../../components/pages/Contact/Contact';

import './navbar.scss';
import { Sling as Hamburger } from 'hamburger-react'

import Logo from './Logo';
import HideLogo from './HideLogo';
import { HashLink as Link } from 'react-router-hash-link';


const activeColors = ['antiquewhite', '#7cd3c7', '#DFE0DF'];
export default function Navbar(props) {
	const [showContactModel, setShowContactModel] = React.useState(false)



	return (
		<>
			{showContactModel && <Contact showModal={showContactModel} handleClose={() => { setShowContactModel(false) }} />}

			<div className='navbar-menu'>
				<div className='nav-menu-logo'></div>
			<div className="nav-menu-rows">
				<div id="nav-about"  >
					<Link to='/about' >
						<div className="navLink"> About</div>
					</Link>
					<span className='arrow'>
						<i className="fas fa-angle-right"></i>
					</span>					</div>

				<div id="nav-project" >
					<Link to='/project'>
						<div className="navLink"> Work</div>
					</Link>
					<span className='arrow'>
						<i className="fas fa-angle-right"></i>
					</span>					</div>
				<div onClick={() => setShowContactModel(true)} >
					Contact
					<span className='arrow'>
						<i className="fas fa-angle-right"></i>
					</span>
				</div>
				</div>
			</div>



		</>



	);

}
